      "persistent": true,
      "dependsOn": [
        "prepare"
      ]
    },
    "snapshots": {
      "dependsOn": [
        "prepare",
        "typecheck",
        "lint"
      ]
    },
    "build:production": {
      "inputs": [
        "yarn.lock",
        "**/package.json",
        "src/**/*"
      ],
      "outputs": [
        "**/build/**"
      ],
      "dependsOn": [
        "prepare",
        "build"
      ]
    },
    "build": {
      "inputs": [
        "yarn.lock",
        "**/package.json",
        "src/**.ts",
        "src/**.tsx"
      ],
      "outputs": [
        "**/dist/**",
        "./apps/next/.next/**",
        "**/types/**"
      ],
      "dependsOn": [
        "^build"
      ]
    }
  }
}

